	@Test
	public void testAppLogin02() {
		//--Mimic User Input
		iFacade.setUsername("Peter");
		iFacade.setPassword("Clarke");
		
		app.appLogin();
		
		//--Expect to unsuccessfully login. And method returns from 3 failed attempts.
		assertEquals(app.getLoggedIn(), false);
